    public static int maxArea(int[] height){
        int max = 0;
        int length = height.length;
        for(int i = 0; i < length - 1; i++){
            for(int j = i + 1; j < length; j++){
                int minHeight;
                if(height[j] > height[i]){
                    minHeight = height[i];
                }else{
                    minHeight = height[j];
                }
                int dimension = (j - i) * minHeight;
                if(dimension > max){
                    max = dimension;
                }
            }
        }
        return max;
    }

